import React, { useState, useEffect } from 'react';

const MeetupDisplay = () => {
  const [meetups, setMeetups] = useState([]);

  useEffect(() => {
    fetch('/meetup.json')
      .then(response => response.json())
      .then(data => setMeetups(data))
      .catch(error => console.error('Error loading meetups:', error));
  }, []);

  return (
    <div>
      {meetups.map((group) => (
        group.items.map((item, idx) => (
          <div key={idx}>
            <p>Time: {item.time}</p>
            <p>
              Title: <a href={item.event_link} target="_blank" rel="noopener noreferrer">{item.title}</a>
            </p>
            <p>Location: {item.location}</p>
            <p>
              Group: <a href={group.group_link} target="_blank" rel="noopener noreferrer">{group.group_title}</a>
            </p>
            <p>Description: {item.description}</p>
          </div>
        ))
      ))}
    </div>
  );
};

export default MeetupDisplay;
